import React from "react";

import "../../css/Challenge/ProgressBar.css"
const ProgressBar = (props) => {
  return (
    <div id = "container">
      <div id = "filler">
        <span id = "label">{`${props.completed}%`}</span>
      </div>
    </div>
  );
};

export default ProgressBar;
